// src/components/VideoTrailer.jsx

import React from "react";
import PropTypes from "prop-types";

const VideoTrailer = ({ videoUrl }) => {
    return (
        <div className="flex space-x-6 overflow-x-auto no-scrollbar scroll-smooth">
            <iframe
                width="560"
                height="315"
                src={videoUrl}
                title="YouTube trailer"
                frameBorder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
                className="lg:w-[500px] md:w-[450px] w-[360px] lg:h-[300px] md:h-[250px] h-[200px] rounded-lg"
            ></iframe>
        </div>
    );
};

VideoTrailer.propTypes = {
    videoUrl: PropTypes.string.isRequired
};

export default VideoTrailer;
